@OptIn(ExperimentalFoundationApi::class)
@Composable
fun CokOyuncu(sayi:Int,viewModel: TekOyuncuViewModel2) {
    val puan = remember { mutableStateOf(0) }
    var state by remember { mutableStateOf(0) }
    var eskicardListesi = viewModel.cardlistesi
    var cardListesi = mutableListOf<Card>()
    for (i in 0..sayi-1){
        cardListesi.add(eskicardListesi.value!!.get(i))
        cardListesi.add(eskicardListesi.value!!.get(i))
    }
    cardListesi.apply { shuffle() }
    val cards: List<Card> by viewModel.getCards().observeAsState(listOf())
    println("kartlar"+ cards)
    Row(modifier = Modifier
        .fillMaxWidth()
        .padding(all = 10.dp),
        verticalAlignment = Alignment.Top,
        horizontalArrangement = Arrangement.SpaceEvenly
    )
    {

        Text(
            text = "Puan 1: ${viewModel.puan1Getir()}",
            color = Color.Blue,
            fontSize = 23.sp
        )
        if(state>=60){
            Text(
                text = "Sayac: 0",
                color = Color.Red,
                fontSize = 23.sp
            )
        }
        else{
            Text(
                text = "Sayac: ${60-state}",
                color = Color.Red,
                fontSize = 23.sp
            )
        }


        Text(
            text = "Puan 2: ${viewModel.puan2Getir()}",
            color = Color.Blue,
            fontSize = 23.sp
        )
    }
    Column(
        modifier = Modifier.fillMaxSize(),
        verticalArrangement = Arrangement.Center,
        horizontalAlignment = Alignment.CenterHorizontally
    ) {

        val kart_sayisi = remember { mutableStateOf(6) }
        kart_sayisi.value=sayi
        val tıklanmaList = ArrayList<Card>()

        var tıklanma = 0

        LazyVerticalGrid(columns = GridCells.Fixed(kart_sayisi.value), content = {
            items(kart_sayisi.value*kart_sayisi.value){ i->
                val kart = cards[i]

                Card(
                    modifier = Modifier
                        .size(100.dp)
                        .padding(all = 10.dp),
                    elevation = 20.dp,
                )
                {
                    Row(
                        modifier = Modifier.clickable {



                            if (cards[i].card_acik_mi){
                                viewModel.cardGorunumuDegistirCoklu(cards[i].card_id.toString())
                            }
                        },
                        horizontalArrangement = Arrangement.Center,
                        verticalAlignment = Alignment.CenterVertically


                    ) {
                        if(cards[i].card_secildi_mi){
                            Text(text = "${cards[i].card_karakteri}")
                        }
                        /*else{
                            AsyncImage(
                                //model = "https://store.donanimhaber.com/6e/fa/55/6efa55aa79ac7ad22d8ad58ec13b6d12.jpg",
                                model = "https://1000logos.net/wp-content/uploads/2021/04/Hogwarts-Logo.png",
                                contentDescription = null
                            )
                        }*/
                        else{

                                var b64 = ""
                                val imageBytes = Base64.decode(b64, 0)
                                val image = BitmapFactory.decodeByteArray(imageBytes, 0, imageBytes.size)
                                val option = BitmapFactory.Options()
                                option.inPreferredConfig = Bitmap.Config.ARGB_8888
                                val bitmap = image.asImageBitmap()
                                Image(bitmap = bitmap, contentDescription = "deneme")

                        }


                    }
                }
            }
        })
        LaunchedEffect(Unit) {
            while(true) {
                delay(1000)
                state++
                viewModel.sayaciGotur(state)
            }
        }

    }
}



